class Solution {
public:
    bool isIsomorphic(string s, string t) {
        map<char, char> m_s;
        map<char, char> m_t;
        for( int i = 0; i < s.length() ; i++ )
        {   
            if(m_s.find( s[i] ) == m_s.end() ) {
                m_s[ s[i] ] = t[i];
            }else if( m_s[ s[i] ] != t[i] ) {
                return false;
            }

            if( m_t.find( t[i] ) == m_t.end() ) {
                m_t[ t[i] ] = s[i];
            }else if( m_t[ t[i] ] != s[i] ) {
                return false;
            }            
        }
        return true;
    }
};

